const fs = require('fs/promises');

async function main() {
  const lines = getRomsInfo();
  await Promise.all(lines.map(async (line) => {
    const [name, url, image, background] = line.split(';');
    const fileName = name.replace(/ /g, '').replace(/\.|-|zip/g, '');

    const romContent = getRomContent(name, url, image, background);
    await fs.writeFile(`${fileName}.sh`, romContent);
  }));

  await fs.writeFile('_init_ubuntu.sh', getInitContent());
}
main();

function getRomContent(name, url, image, background) {
  return `#!/bin/bash
NAME="${name}"
TAGS=()
ROM_URL="${url}"
IMG_URL="${image}"
BG_IMG_URL="${background}"
MUSIC_URL=""

SCRIPT_PATH="$(realpath "$0")"
SCRIPT_NAME="$(basename "$SCRIPT_PATH")"
ROM_FILE="\${SCRIPT_NAME%.sh}.zip"

# === Info ===
if [ "$1" = "info" ]; then
    echo "üïπÔ∏è  Nome=$NAME"
    echo -n "üìã Tags="
    IFS=","
    echo "\${TAGS[*]}"
    echo "üñºÔ∏è  Capa=$IMG_URL"
    echo "üåÑ Fundo=$BG_IMG_URL"
    echo "üéµ M√∫sica=$MUSIC_URL"
    exit 0
fi

# === Download ROM (if not exists) ===
if [ ! -f "$ROM_FILE" ]; then
    echo -e "‚¨áÔ∏è  Baixando ROM...\n"
    wget -nv --show-progress --progress=bar:force:noscroll -O "$ROM_FILE" "$ROM_URL"
    echo -e "\n-------------------------------------------------\n"
fi

# === Execute ROM ===
echo "üöÄ Iniciando ROM..."
flatpak run org.libretro.RetroArch -L snes9x_libretro.so "\${SCRIPT_PATH%/*}/$ROM_FILE"`;
}

function getInitContent() {
  return `#!/bin/bash
sudo apt update
sudo apt install wget flatpak -y
sudo apt install gnome-software-plugin-flatpak -y

flatpak remote-add --if-not-exists flathub https://dl.flathub.org/repo/flathub.flatpakrepo
flatpak install flathub org.libretro.RetroArch -y
chmod +x *.sh

echo
echo "---------------------------------------------------------------------------"
echo
echo "‚úÖ RetroArch instalado com sucesso!"
echo "‚ÑπÔ∏è  Abra o RetroArch e instale o core SNES9x manualmente:"
echo "   RetroArch > Load Core > Download a Core > Nintendo - SNES / SFC (Snes9x)"
echo "üéÆ Configure os controles"
echo "   Settings > Input > RetroPad Binds > Port Controls"
echo "‚ùå Feche o Retroarch"
echo "üîÑ Reinicie o sistema se necess√°rio."`;
}

